import React from "react";
const Form = () => {
  return (
    <React.Fragment>
      <form>
        <label>ID:</label>
        <input type="number"></input>
        <label>Product:</label>
        <input type="text"></input>
        <label>Price:</label>
        <input type="number"></input>
        <button type="submit">Add Product</button>
      </form>
    </React.Fragment>
  );
};
export default Form;
